import * as React from 'react';
import { BasicCard} from './Components/Card'
import Card from '@mui/material/Card';
import Paper from '@mui/material/Paper'
import { Header } from './Components/Header'
import { ResponsiveAppBar } from './Components/Menu';
import { ThemeProvider } from '@mui/material';
import { createTheme } from '@mui/material';
import { themeOptions } from './theme'
// import CssBaseline from "@material-ui/core/CssBaseline";

import './App.css'

const theme = createTheme(themeOptions)

function App() {
  return (

    <div className="App">
      <ThemeProvider theme={theme}>
        {/* <CssBaseline /> */}
        <header className="App-header">
          <Paper elevation={0} className='backgroundPaper'>
            <ResponsiveAppBar posistion='fixed' sx={{marginbottom: '3%'}} elevation={10}/>
            <BasicCard title='Personal Website' content='Near the end of this summer, I decided I wanted to put the little bit of HTML, CSS and JavaScript that I had learned over the summer to good use and make myself a personal website! You can find all the code for it over on my personal github account here.' link='https://google.com'/>
          </Paper>
        </header>

        <Header />
      </ThemeProvider>

    </div>
  );
}

export default App;
